import React from 'react';
import './App.css';
import CardPile from './CardPile.js';
import "bootstrap/dist/css/bootstrap.min.css";


class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      CurrentCard: "AS"
    };
  }

  render() {
    return (
      <CardPile CardPile={this.CardPile} />
    )
  }
}
export default App;
